export default {
  name: "Toolbar",
  props: {
    border: {
      type: Boolean,
      default: true
    },
    // 是否显示边框
    small: {
      type: Boolean,
      default: false
    },
    // 边距变小
    mini: {
      type: Boolean,
      default: false
    },
    // 边距超小
    zero: {
      type: Boolean,
      default: false
    },
    // 无边距
    leftStyle: {
      default: null
    },
    rightStyle: {
      default: null
    },
    disabled: Boolean,
    // 是否可操作
    bgc: {
      type: String,
      default: $_theme.bg_color
    }
  }
};
